import React from "react";
import styled from "styled-components";

const Section = styled.section`
  min-height: 100vh;
  width: 100vw;
  background-color: ${(props) => props.theme.body};
  position: relative;
`;
const Title = styled.h1`
  font-size: ${(props) => props.theme.fontxxl};
  text-transform: capitalize;
  color: ${(props) => props.theme.text};

  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  border-bottom: 2px solid ${(props) => props.theme.text};
  width: fit-content;
  margin: 0 auto;
  margin-bottom: 1rem;
`;

const Container = styled.div`
  width: 75%;
  margin: 2rem auto;
  display: flex;
  justify-content: space-around;
  align-items: center;
  flex-wrap: wrap;
`;

const Item = styled.div``;

const ImageContainer = styled.div``;

const MemberComponent = ({ img, name = "", position = "" }) => {
  return (
    <Item>
      <ImageContainer>
        <img src="" alt={name} />
      </ImageContainer>
    </Item>
  );
};

const Team = () => {
  return (
    <Section>
      <Title>Team</Title>
      <Container>
        <div>member1</div>
        <div>member1</div>
        <div>member1</div>
        <div>member1</div>
        <div>member1</div>
        <div>member1</div>
        <div>member1</div>
        <div>member1</div>
      </Container>
    </Section>
  );
};

export default Team;
